import React from 'react';
import ExpensesTable from '../components/expensesPage/ExpensesTable';
import { Link } from 'react-router-dom';

const ExpensesPage = () => {
  return (
    <div>
      <h1>Расходы</h1>
      <Link to="/">Затраты</Link>
        <ExpensesTable/>
    </div>
  );
};

export default ExpensesPage;
